package com.zyd.web.api;

import java.util.List;
import java.util.Map;

import junit.framework.TestCase;

import com.tj.common.util.test.CommonTestUtil;
import com.zyd.ATestUtil;
import com.zyd.Constants;
import com.zyd.core.db.HibernateUtil;
import com.zyd.core.objecthandler.Handler;
import com.zyd.web.house.TestObjectManipulation;

@SuppressWarnings("unchecked")
public class TestImage extends TestCase {
    public final static String imageData = "";
    public final static String imageData2 = "";

    public void testOneImage() throws Exception {
        HibernateUtil.deleteAllObject(HibernateUtil.EntityNames.House);
        Map map = CommonTestUtil.loadValueMapFromClassPathFile(TestObjectManipulation.class, "house1.prop", Constants.Encoding_DEFAULT_SYSTEM);
        map.put(Handler.Parameter.PARAMETER_IMAGE_DATA_PREFIX + "0", imageData);
        map.put(Handler.Parameter.PARAMETER_IMAGE_SUFFIX_PREFIX + "0", "png");
        map.put(Handler.Parameter.PARAMETER_IMAGEFIELD_PREFIX + "0", "photo");
        map.put(Handler.Parameter.PARAMETER_IMAGECOUNT, "1");
        assertTrue(ATestUtil.createObject(map));
        List list = HibernateUtil.loadObject(HibernateUtil.EntityNames.House);
        assertTrue(list.size() == 1);
        map = (Map) list.get(0);
        String uuid = (String) map.get("photo");
        assertNotNull(uuid);
    }

    public void testTwoImage() throws Exception {
        HibernateUtil.deleteAllObject(HibernateUtil.EntityNames.House);
        Map map = CommonTestUtil.loadValueMapFromClassPathFile(TestObjectManipulation.class, "house1.prop", Constants.Encoding_DEFAULT_SYSTEM);
        map.put(Handler.Parameter.PARAMETER_IMAGE_DATA_PREFIX + "0", imageData);
        map.put(Handler.Parameter.PARAMETER_IMAGE_SUFFIX_PREFIX + "0", "png");
        map.put(Handler.Parameter.PARAMETER_IMAGEFIELD_PREFIX + "0", "photo");

        map.put(Handler.Parameter.PARAMETER_IMAGE_DATA_PREFIX + "1", imageData2);
        map.put(Handler.Parameter.PARAMETER_IMAGE_SUFFIX_PREFIX + "1", "png");
        map.put(Handler.Parameter.PARAMETER_IMAGEFIELD_PREFIX + "1", "photo");

        map.put(Handler.Parameter.PARAMETER_IMAGE_DATA_PREFIX + "2", imageData2);
        map.put(Handler.Parameter.PARAMETER_IMAGE_SUFFIX_PREFIX + "2", "png");
        map.put(Handler.Parameter.PARAMETER_IMAGEFIELD_PREFIX + "2", "agentPhoto");

        map.put(Handler.Parameter.PARAMETER_IMAGECOUNT, "3");

        assertTrue(ATestUtil.createObject(map));
        List list = HibernateUtil.loadObject(HibernateUtil.EntityNames.House);
        assertTrue(list.size() == 1);
        map = (Map) list.get(0);
        String uuid = (String) map.get("photo");
        assertNotNull(uuid);
        assertEquals(uuid, 2, uuid.split(";").length);

        uuid = (String) map.get("agentPhoto");
        assertNotNull(uuid);
        assertEquals(uuid, -1, uuid.indexOf(';'));
    }
}
